import React from 'react';
import './Header.css';

const Header = () => {
  return (
    <header className="header">
      <div className="logo">
        <h1>بنك المستقبل</h1>
      </div>
      <nav className="nav">
        <ul>
          <li><a href="#" className="active">الرئيسية</a></li>
          <li><a href="#">خدماتنا</a></li>
          <li><a href="#">عن البنك</a></li>
          <li><a href="#">اتصل بنا</a></li>
        </ul>
      </nav>
    </header>
  );
};

export default Header;
